    false,nt"url": null,nt"notes": "As part of ongoing research into the status
    of Vermont's marsh birds, a statewide census of the black tern nesting population
    was undertaken again in the year 2000. The recent trend of higher percentages of
     black tern nesting concentrated at the north end of Lake Champlain continued in
    2000, with all nesting being in and around the Missisquoi National Wildlife Refuge.
    This is a large protected wetland complex so it is probably the best area in Vermont
    for terns to concentrate. This report takes a look at marsh bird population trends
    within certain marshes in Vermont, and investigates the effect of water level and
    marsh vegetation changes on marsh bird numbers.",nt"license_title": "License
